//            11-08 16:21:41.645 27320-27896/com.moyou.moyoux.xmoyou E/打印下返回值: {"code":1,"message":"成功","data":[{"diaryId":29746,"text":"一、对于男生、这是一个教学贴。\n\n二、同时可以给女生们一个提醒、别动不动就觉得自己遇上了真命天子、他很可能是一个精明的投机者。\n\n1.寻找切入话题\n\n通过头像、昵称、签名、空间动态、朋友圈、留言板等公开信息找到她的兴趣爱好、特别讨厌的事物、一些个人的小习惯。\n\n例一：你发现\n①：她喜欢听周杰伦。\n②：她喜欢听万青。\n③：她喜欢打羽毛球。\n④：她喜欢美剧。\n⑤：她讨厌鹿晗。\n⑥：她讨厌不清不楚的男女暧昧关系。\n⑦：她特别不喜欢吃菠萝。\n⑧：她有每天起床后喝一杯热水的习惯。\n⑨：她有每天晚上跑步的习惯。\n\n你会选择哪个话题切入呢？\n正确答案是②、④、⑥、⑧。\n前期话题切入优先选择小众或深度类、并形成“他乡遇故知”和“同仇敌忾”的局面。\n\n当然其它选项也不要忘了、在后期仍然有很大的用处。\n\n\n2.负起带节奏的重担\n\n①：知识面要广、不必什么都懂、但什么你都能说上两句。\n②：有趣机智、脑回路清奇以求脱颖而出、这里考验的是段子储备量和临场反应。烂大街的梗就不要用了、只会让你显得更加无趣。前期幽默的形式以自黑为主、中后期以黑她为主、当然是不伤大雅的那种黑。\n③：前期做一个合格的捧哏，不要喧宾夺主。当一个话题结束时，立刻从她的近几条消息中找到开始下一个话题的关键词，过渡要自然。\n中后期做一个合格的逗哏、不要冷场。可以开始分享自己有趣的故事了、但要注意观察对面的反应随时调整。\n④：拒绝尬聊。在发现话题进行不下去的时候、请找个借口赶紧溜了、再多说一句都可能会死。\n⑤：换位思考。你打出一行字后或准备说出一句话时、先把自己带入到她的位置、如果你发现这行字给人一种“不知道回复什么才好”的感觉、那么删了这行字、再打一行字并重复步骤。相信我、行云流水的聊天体验是每个人都喜欢的。\n⑥：先人一步。这个难度系数较高、首先要合理预测她对某事物的看法、在她没开口前、你先把这个看法说了。这个做法会形成“三观合、默契、偶遇知音”的假象。\n⑦：可以给她一个专属代称、就是只有你才会那么叫她的那种。\n⑧：从以前的聊天记录或面谈中找到几个有趣的梗、这些梗这么有意思千万不能浪费、放心重复吧、不会烂的。\n⑨：无论如何、一定要尊重她、开玩笑要懂得分寸、这是底线。\n","userId":108549,"avatar":"user/avatar/a1f1484f-9997-4583-aca6-f728a0cc3b7f.jpg","nickname":"单","city":"郑州","url":"diary/pic/54f01f5b-5c6a-4916-a405-cf32919e151a.jpg","picTotal":1,"extendData":"600_644","diaryTitle":"安利一波男生撩妹的套路","readTotal":1562,"relateDiaryId":0,"relateState":0,"relateType":0,"relateCreatorId":"","relateNickname":"","sourceType":0,"h5Url":"","urlAnalysisSuccess":0,"shareAppName":""},{"diaryId":29745,"text":"这是来到西双版纳的第三个清晨。早晨八点的天气仍然是清冷的，天色也仍然是灰青色的。\n\n我坐在房前回廊的长椅上看书，书名是《西藏的十五日》。\n\n每次出行我都会带本书，书的厚度以适合在途中正好看完为标准。这次云南行我带了这本《西藏十五日》。是一种很奇怪的一种感觉，也许是去年这个时候的西藏行一直在心里挥之不去的缘故吧。\n\n此时看到书中作者对羊湖的描写：\n\n它很美，很干净，干净得一点都性感不起来，无法让我冲动。\n就像一个冷冷的花瓶，静静的静静的……\n你知道当一个东西干净得过分时，便会没有了生气，就像一个美丽的女子，当她里�
